import "./App.css";
import axios from "axios";
import React from "react";

class App extends React.Component {
  statte = { datails: [] };

  componentDidMount() {
    let data;
    axios
      .get("http://localhost:8000")
      .then((res) => {
        data = res.data;
        this.setState({ datails: data });
      })
      .catch((err) => {
        console.log(err);
      });
  }
  render() {
    return (
      <div className="App">

      </div>
    );
  }
}

export default App;
